  class TrieNode {
    children: Map<string, TrieNode>;
    isEndOfWord: boolean;

    constructor() {
        this.children = new Map();
        this.isEndOfWord = false;
    }
  }

  class Trie {
    root: TrieNode;

    constructor() {
        this.root = new TrieNode();
    }

    insert(word: string): void {
        let current = this.root;
        for (const char of word) {
            if (!current.children.has(char)) {
                current.children.set(char, new TrieNode());
            }
            current = current.children.get(char)!;
        }
        current.isEndOfWord = true;
    }

    search(word: string): boolean {
        let current = this.root;
        for (const char of word) {
            if (!current.children.has(char)) {
                return false;
            }
            current = current.children.get(char)!;
        }
        return current.isEndOfWord;
    }
  }

  function createTrieFromWords(words: string[]): Trie {
    const trie = new Trie();
    for (const word of words) {
        trie.insert(word);
    }
    return trie;
  }
  const threePoints = ['a','e','i','o','n','r','s','t']
  const fivePoints = ['b','c','d','f','g','h','l','m','p','u','y']
  const eightPoints = 'jkqvwxz'.split('')

  const getTileScore = (word: string[]) => {
    return word.reduce((acc, l) => {
      if (threePoints.includes(l)) {
        return acc + 3
      }
      if (fivePoints.includes(l)) {
        return acc + 5
      }
      if (eightPoints.includes(l)) {
        return acc + 8
      } else if (l.length === 2) {
        return acc + 10
      }
      console.error("UNKNOWN SCORE", l)
      return acc;
    }, 0)
  }
